24 is an American television series produced for the Fox network created by Joel Surnow and Robert Cochran, and starring Kiefer Sutherland as Counter Terrorist Unit (CTU) agent Jack Bauer. Each 24-episode season covers 24 hours in the life of Bauer, using the real time method of narration. Premiering on November 6, 2001, the show spanned 192 episodes over eight seasons, with the series finale broadcast on May 24, 2010. In addition, a television film, 24: Redemption, was broadcast between seasons six and seven.


